// this line should not be removed
var wSideCurrency = angular.module("wSideCurrency",[]);

wSideCurrency.controller( "wSideCurrencyController", function( $scope ) {
    $scope.initialize = function(arg) {
	var dq = new DataQuery( 'qGetTheCurrs' );
	dq.execute().
	done( function() {
		$scope.$apply(function() {
			$scope.results = dq.getData();
		});
	});
	var dq = new DataQuery( 'qCurrencyRatesJson' );
	dq.execute().
	done( function() {
		$scope.$apply(function() {
			$scope.currency = dq.getData();
			console.log($scope.currency);
		});
	});
	};


	 $scope.exchangeRates=function(){
	     $scope.fromRate=$scope.FindCurr($scope.con_from);
	     $scope.toRate=$scope.FindCurr($scope.con_to);
	     rr=  $scope.from_mdl/$scope.fromRate;
         $scope.resultofconversion= rr*$scope.toRate;
	 }
	 	$scope.FindCurr = function(arg) { 

	   $scope.currency.forEach(function(item) {
	        if(item.currency==arg){
	            return item.value;

	        }
	    })
	    };
	 $scope.initialize().done(function(){
	 $scope.exchangeRates();})


});
